import React from 'react';
import './App.css'; // You can create this CSS file for styling

const App = () => {
  return (
    <div className="app">
      <div className="section landing">
        <h1>Welcome to CleanNature Garbage Collection</h1>
        <p>Your trusted partner for sustainable waste management.</p>
      </div>
      <div className="section about">
        <h2>About Us</h2>
        <p>We are dedicated to keeping your community clean and green.</p>
      </div>
      <div className="section contact">
        <h2>Contact Us</h2>
        <p>Reach out to us for inquiries and information.</p>
      </div>
    </div>
  );
};

export default AboutUs;
